import React from 'react';
import ListItem from './ListItem';
import './css/ListView.css';  // Ensure you have appropriate CSS for ListView

const ListView = ({ items }) => {
  return (
    <div className="list-view">
      <div className="list-header">
        <div className="header-item">Job Title</div>
        <div className="header-item">Description</div>
        <div className="header-item">Company</div>
        <div className="header-item">Skills</div>
        <div className="header-item">Status</div>
      </div>
      <ul>
        {items.map(item => (
          <ListItem key={item._id} item={item} />
        ))}
      </ul>
    </div>
  );
};

export default ListView;
